SchemaVersion: 2018-07-01
Owner: "@10gen/server-security"
Description: |
  Performs a series of insert operations, using the following properties:
    - All documents have 11 fields, including 1 _id field, and 10 data fields.
    - The first 0 data fields are encrypted.
    - _id is always unique.
    - Values in data fields fit a 'pbl_cf1' distribution. .
    - The insertions are performed by 1 client threads.
  This test is uniquely identified as 'Query-es1-1-1'.





Clients:
  EncryptedPool:
    QueryOptions:
      maxPoolSize: 400



LoadPhase: &load_phase
  Repeat: 100
  Collection: &collection_param {^Parameter: {Name: "Collection", Default: "pbl_cf1"}}
  MetricsName: "load"
  Operations:
  - OperationName: insertOne
    OperationMetricsName: inserts
    OperationCommand:
      Document:
        LoadConfig:
          Path: ../encrypted2/maps_pbl.yml
          Key: document_insert_pbl
          Parameters:
            Database: ignored


Actors:
- Name: InsertActor
  Type: CrudActor
  Threads: 1
  Database: genny_qebench
  ClientName: EncryptedPool
  Phases:
  
  
